import React from 'react'
import { Link } from 'react-router-dom'

function ProductList({ products }) {
  const productList = products.map(product => {
    return (
        <tr>
        <th>
            {product.code}
        </th>
        <th>
            {product.name}
        </th>
        <th>
            {product.description}
        </th>
        <th>
            <Link exact to={'/updateproduct/' + product.code} key={product.code}> Update
            </Link>
        </th>
        <th></th>

    </tr>
    )
  })
  
  return (
      {productList}
  )
}

export default ProductList
